import React from 'react';
import axios from 'axios';

const Main = props => {

    return(
        <div>
            <h2>These pets are looking for a good home</h2>
            <table className = "table table-bordered">
                <tr>
                    <th>Name</th>
                    <th>Species</th>
                    <th>Ability</th>
                    <th>Actions</th>
                </tr>
                </table>

        </div>
    )
}

export default Main;
